    const auth = useAuth()

    return (
        <div className="mess-page">
            <div className="mess-container">
                <div className="mess-user">
                    <div className="mess-auth">
                        {auth.username}
                    </div>
                    <div>
                        User
                    </div>
                </div>

                <div className="mess-main">
                    Mess
                </div>
            </div>
        </div>
    )
}

export default Messages
